import React, { useEffect, useState } from 'react';
import axios from 'axios';

export default function Detalles() {
  const [detalles, setDetalles] = useState([]);

  useEffect(() => {
    axios.get('http://localhost:8000/api/detalles/')
      .then(res => setDetalles(res.data))
      .catch(err => console.error(err));
  }, []);

  return (
    <div>
      <h2>Detalles de Pedidos</h2>
      <table className="table table-bordered">
        <thead>
          <tr>
            <th>ID</th><th>Pedido</th><th>Producto</th><th>Cantidad</th>
          </tr>
        </thead>
        <tbody>
          {detalles.map(d => (
            <tr key={d.id}>
              <td>{d.id}</td>
              <td>{d.orderID}</td>
              <td>{d.productID}</td>
              <td>{d.quantity}</td>
            </tr>
          ))}
        </tbody>
      </table>
    </div>
  );
}
